import React from "react";
import hiring from "../icons/Group 1103.png";

export default function Profile() {
    return (
      <div>
        <div className="profilepage">
          <div
            style={{
              backgroundColor: "#02979d",
              paddingTop: "25%",
              paddingInline: "35%",
            }}
          >
            <img
              src={hiring}
              style={{ width: "85px", height: "85px", borderRadius: "50px", marginBottom: "10px" }}
            />
            <span
              style={{ color: "rgba(255, 255, 255, 1)", maxWidth: "100px" }}
            >
             <span className="welcomeBack">Welcome Back!</span> 
              <br />
              <span className="profileName">
              Sarah Smith</span>
            </span>
          </div>
          <div>Hello</div>
          <div>knjnm</div>
        </div>
      </div>
    );
}
